import { Injectable } from '@angular/core';
import { HttpClient } from '@angular/common/http';
import { Observable } from 'rxjs';
import { IResponse } from '../models/search-response.model';

@Injectable({
  providedIn: 'root',
})
export class ApiService {
  private HTTP_URL = 'https://www.googleapis.com/youtube/v3/';

  private HTTP_KEY = 'AIzaSyCaIsx1V1ywnN-Selao8dbuKMf2_a-BOuY';

  constructor(private http: HttpClient) {}

  getItems(): Observable<IResponse> {
    return this.http.get<IResponse>(`${this.HTTP_URL}search?key=${this.HTTP_KEY}&type=video&part=snippet&maxResults=8&q=js`);
  }

  getItem(): Observable<IResponse> {
    return this.http.get<IResponse>(`${this.HTTP_URL}search?key=${this.HTTP_KEY}&type=video&part=snippet&maxResults=8&q=js`);
  }
}
